bac2[,2:ncol(bac2)] <- sapply(bac2[,2:ncol(bac2)], as.character)
bac2[,2:ncol(bac2)] <- sapply(bac2[,2:ncol(bac2)], as.numeric)

str(bac2)

table<-read.table(text=input, header=T)

table_a<- merge(x=table, y=bac2, by="SampleID")
dim(table)
dim(bac2)
dim(table_a)

subject_list<-c('Weight_Gain', 'Ruminococcaceae', 'Enterococcaceae', 'Staphylococcaceae', 'Fusobacteriaceae', 'Bifidobacteriaceae', 'Verrucomicrobiaceae', 'Erysipelotrichaceae', 'Peptococcaceae', 'Lachnospiraceae', 'Clostridiaceae', 'Eubacteriaceae')
#subject_list<-c('Weight_Gain')

for (subject in subject_list){
  print(subject)
  table2<-table_a[,c('SampleID', 'Sex_Diet', 'Week', subject)]
  table3<-melt(table2, measure.vars = subject)
  head(table3)
  
  table4<-ddply(table3, .(Sex_Diet, Week), summarize, mean=mean(value), SE=sd(value)/sqrt(length(value)))
  #table4<-ddply(table3, .(Sex_Diet, Week), summarize, mean=mean(value), SE=sd(value))
  table4$lower = table4$mean + table4$SE
  table4$upper = table4$mean - table4$SE
  ylim<-max(table4$mean)
  
  pd <- position_dodge(width = 0.5) # move them .2 to the left and right
  
  p<-ggplot(table4, aes(y=mean, ymin=lower, ymax=upper, colour=Sex_Diet)) +
    scale_colour_manual(values=c('F_Inulin' = "pink", 'M_Inulin' = "cyan", 'F_Non_Inulin'= "red", 'M_Non_Inulin'="blue")) + 
    geom_point(position=pd, size=3) + geom_line(position=pd)  +
    geom_errorbar(position=pd, aes(width=2), show.legend=FALSE) +
    theme_bw() +
    ggtitle(subject) +
    theme(text = element_text(size = 15),
          panel.grid.major = element_blank(),panel.grid.minor = element_blank(),
          axis.line = element_line(),panel.border =  element_blank())+
    scale_y_continuous(limits=c(0,ylim*1.3), expand = c(0, 0)) + 
    scale_x_continuous(limits=c(-0.5,12), expand = c(0, 0), breaks=c(0, 1, 3, 5, 7, 9, 11))
  p <- p + aes(x=Week)
  ggsave(plot = p,paste(subject,"_plots.pdf", sep = ""),dpi=100,height = 6,width = 8)  
}
